void CMainFrame::resetButtons(Fl_HoverButton* self) {
  if (self!=btnBrush)
	btnBrush->value(0);
if (self!=btnFloodFill)
	btnFloodFill->value(0);
//if (self!=btnErase)
//	btnErase->value(0);
if (self!=btnForce)
	btnForce->value(0);
//if (self!=btnConstraint)
//	btnConstraint->value(0);
//if (self!=btnEraseFem)
//	btnEraseFem->value(0);
if (self!=btnDrawingTools)
	btnDrawingTools->value(0);
if (self!=btnSelect)
{
	btnSelect->value(0);
	editMenuCut->deactivate();
	editMenuCopy->deactivate();
}
else
{
	editMenuCut->activate();
	editMenuCopy->activate();
}
//if (self!=btnPaste)
//	btnPaste->value(0);
//if (self!=btnPasteWin)
//	btnPasteWin->value(0);
if (self!=btnConstraint2)
	btnConstraint2->value(0);
}

